  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('bf1abcad-37e4-4226-b757-bedc391dd954', 'Side Jackknife', '[]', 2, 'Jackknife', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123744+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('2c362e97-4248-48aa-ae31-d55895d93e26', 'Cable Seated Crunch', '[''Seat on a flat bench with your back facing a high pulley.'', ''Grasp the cable rope attachment with both hands (with the palms of the hands facing each other) and place your hands securely over both shoulders. Tip: Allow the weight to hyperextend the lower back slightly. This will be your starting position.'', ''With the hips stationary, flex the waist so the elbows travel toward the hips. Breathe out as you perform this step.'', ''As you inhale, go back to the initial position slowly.'', ''Repeat for the recommended amount of repetitions.'']', 1, 'Crunch', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123759+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('f06d09b6-ebf3-4c51-8661-261f792569f8', 'Bent Press', '[''Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulders by extending through the legs and hips as you raise the kettlebell towards your shoulder. The wrist should rotate as you do so. This will be your starting position.'', ''Begin my leaning to the side opposite the kettlebell, continuing until you are able to touch the ground with your free hand, keeping your eyes on the kettlebell. As you do so, press the weight vertically be extending through the elbow, keeping your arm perpendicular to the ground.'', ''Return to an upright position, with the kettlebell above your head. Return the kettlebell to the shoulder and repeat for the desired number of repetitions.'']', 2, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123762+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('2d4f2e9a-598f-4df9-bc1a-71d967d3888f', 'Stability Ball Pike With Knee Tuck', NULL, NULL, 'Knee tuck', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123764+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('63d4325d-e2d7-4325-8e0d-831d3f7d3a37', 'Sledgehammer Swings', NULL, NULL, 'Swing', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123766+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('2daf95b7-364d-4b04-aa6b-eea85dc75668', 'Plank', NULL, NULL, 'Plank', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123767+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('bb412fba-8536-445e-8bfc-54675f472fc3', 'Full Moon', '[''Start on the floor in a seated position with your hands placed behind you slightly wider than shoulder-distance apart. Extend your legs out in front of you, and lean back slightly. This will be your starting position.'', ''Start by swinging your legs out to the side, then up towards your chest, and back down to the starting position. Essentially making a large circle. As you bring your legs towards you, lift your chest up, bringing it closer to your legs.'', ''Alternate directions, moving clockwise to counterclockwise with each repetition. Try to keep your back straight and your abs engaged the entire time.'', ''Complete for the recommended number of repetitions.'', ''Tip: To make it easier, have a slight bend at the knees.'']', 1, 'Leg raise (Complex)', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123769+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('8217e3bd-1d6b-4b10-ad3c-3f7a39c38295', 'Wind Sprints', NULL, NULL, 'Knee raise (Alternate)', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123771+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('a9d4fb63-a0f3-47fe-9710-72edb3b463c5', 'Partner Lying Leg Raise With Throw Down', '[\"Lie supine on the floor with your feet together; your partner should position one foot on either side of your head and stand upright with his knees slightly bent. Grasp your partner''s ankles to stabilize your torso. This will be your starting position.\", ''With a slight bend in your knees, do a reverse-crunch movement, raising your feet toward your partner while lifting your hips off the floor.'', ''Your partner should grab your ankles and push your feet back toward the start position. Donâ€™t allow your feet to contact the floor and smoothly reverse the direction, repeating for reps.'']', 1, 'Leg raise (Partner)', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123773+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('6d717aeb-3ba7-4dc4-8220-c78c6964bd51', 'Partner Hanging Knee Raise With Throw Down', NULL, NULL, 'Knee raise (Partner)', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123774+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('80454c38-934f-4ae2-876f-2f61cf58c9a9', 'Shoulder Tap', '[]', 2, 'Crawl', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123776+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('fa72ece0-c475-41c2-84d1-38e05b319b19', 'Kettlebell Pass Between The Legs', '[''Place one kettlebell between your legs and take a comfortable stance. Bend over by pushing your butt out and keeping your back flat.'', ''Pick up a kettlebell and pass it to your other hand between your legs, in the fashion of a \"W\". Go back and forth for several repetitions.'']', 1, 'Kettlebell pass', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123777+00:00', 'GMT');",
