  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('d9a6111f-5a45-4775-8d85-925f2657cb67', 'Single Arm Dumbbell Carries', NULL, NULL, 'Carry', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123899+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('d1b31a4c-e2ad-4426-bfa8-3e0d94adf292', 'Spider Crawl', '[''Begin in a prone position on the floor. Support your weight on your hands and toes, with your feet together and your body straight. Your arms should be bent to 90 degrees. This will be your starting position.'', ''Initiate the movement by raising one foot off of the ground. Externally rotate the leg and bring the knee toward your elbow, as far forward as possible.'', ''Return this leg to the starting position and repeat on the opposite side.'']', 2, 'Crawl', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.123901+00:00', 'GMT');",
