  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('c74ec479-711c-4812-b023-519ec9cb59fb', '3/4 Sit-Up', '[''Lie down on the floor and secure your feet. Your legs should be bent at the knees.'', ''Place your hands behind or to the side of your head. You will begin with your back on the ground. This will be your starting position.'', ''Flex your hips and spine to raise your torso toward your knees.'', ''At the top of the contraction your torso should be perpendicular to the ground. Reverse the motion, going only Â¾ of the way down.'', ''Repeat for the recommended amount of repetitions.'']', 2, 'Sit-up', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124025+00:00', 'GMT');",
