  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('6e0f6c5b-c907-4ff7-8c54-9dbeea3eb5af', 'Machine Double Crunch', NULL, NULL, 'Crunch', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124057+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('bb93937c-1a16-4010-873b-89b1f3ce44ea', 'V-Sit Dumbbell Triceps Extension', NULL, NULL, 'Dip', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124059+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('6c29e7e8-9205-48bc-b7a9-2940a8fa87fe', 'Russian Bar Dip', '[''Hop onto the parallel bars with your arms extended to support yourself, hands facing in. Keep your body vertical. This will be your starting position.'', ''Lower yourself under control till thereâ€™s about a 90-degree bend in your shoulders, your forearms still perpendicular to the bars. Immediately shift your torso backward by repositioning your forearms so theyâ€™re now fully atop the parallel bars, body still straight.'', ''Shift back the other way by moving your forearms to a perpendicular position once again. Contract your pecs and triceps to press back up to full arm extension, repeating for reps.'']', 2, 'Dip', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124060+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('90a18750-8720-4059-bd31-aa0582ce2e9a', 'Seated Straigh-Bar Curl Superset', '[''Sit erect on the end of a flat bench, feet out in front and knees bent about 90 degrees. Grasp a fixed barbell out wide with an underhand grip, a hand position that puts more emphasis on the biceps short head. This will be your starting position.'', ''Without using body English, do this partial-rep movement by contracting your biceps to curl the bar up to a point just below your chin, then release under control, ensuring the bar doesnâ€™t rest atop the thighs in the bottom position. Repeat for the designated number of reps.'', ''Quickly reposition your hands to a shoulder-width grip and repeat for reps.'', ''Finally switch to a close grip, which preferentially emphasizes the long head, for the final number of reps.'']', 1, 'Curl', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124063+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('00de13fd-32cd-4fc5-91eb-a41ac77e53f2', 'Bottoms-Up Clean From The Hang Position', '[''Initiate the exercise by standing upright with a kettlebell in one hand.'', ''Swing the kettlebell back forcefully and then reverse the motion forcefully.Crush the kettlebell handle as hard as possible and raise the kettlebell to your shoulder.'']', 1, 'Clean', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124065+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('b1bf399f-b26b-4879-9ef7-bc76d33273ca', 'Incline Push-Up Close-Grip', NULL, NULL, 'Push-up', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124066+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('5ebc6032-975c-484d-ba67-2a523f404f2e', 'Zottman Preacher Curl', '[''Grab a dumbbell in each hand and place your upper arms on top of the preacher bench or the incline bench. The dumbbells should be held at shoulder height and the elbows should be flexed. Hold the dumbbells with the palms of your hands facing down. This will be your starting position.'', ''As you breathe in, slowly lower the dumbbells keeping the palms down until your upper arm is extended and your biceps are fully stretched.'', ''Now rotate your wrists once you are at the bottom of the movement so that the palms of the hands are facing up.'', ''As you exhale, use your biceps to curl the weights up until they are fully contracted and the dumbbells are at shoulder height. Again, remember that to ensure full contraction you need to bring that small finger higher than the thumb.'', ''Squeeze the biceps hard for a second at the contracted position and rotate your wrists so that the palms are facing down again.'', ''Repeat for the recommended amount of repetitions.'']', 2, 'Curl', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124067+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('76616168-8ca8-465f-9fa6-e3034cf6f902', 'Lying Close-Grip Bar Curl On High Pulley', '[''Place a flat bench in front of a high pulley or lat pulldown machine.'', ''Hold the straight bar attachment using an underhand grip (palms up) that is about shoulder width.'', ''Lie on your back with your head over the end of the bench.'', ''Now extend your arms straight above your shoulders. Your torso and your arms should make a 90-degree angle and the elbows should be in. This will be your starting position.'', ''As you breathe out, curl the bar down in a semicircular motion until it touches your chin. Squeeze the biceps for a second at the top contracted position. Tip: As you execute this motion only the forearms should move. At no time should the upper arms be moving at all. They are to remain perpendicular throughout the movement.'', ''Return to starting position slowly.'', ''Repeat for the recommended amount of repetitions.'']', 1, 'Curl', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124068+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('0ff41240-f891-4226-afd1-7c97b0fd58ee', 'One-Arm Plank Dumbbell Biceps Curl', NULL, NULL, 'Curl', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124070+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('3808e7eb-9bf5-4128-ad64-453b97d62fd1', 'Suspended Triceps Press', '[''Adjust the straps to about shoulder height. Taking the handles with a pronated grip, lean into them supporting your weight with your arms straight. Your hips and knees should be extended. This will be your starting position.'', ''Perform the movement by slowly allowing your elbow to flex. Only the forearm should move, with the humerus (upper arm) maintaining its position.'', ''As the elbow closes below 90 degrees, pause. Complete the exercise by returning to the starting position by extending the elbow.'']', 1, 'Press', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124071+00:00', 'GMT');",
