  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('947f9a8f-cd6f-4202-b17c-f86949bce921', 'Cross Body Hammer Curl', NULL, NULL, 'Curl', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124354+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('1050b713-6de3-44ae-83b8-87d5d1fa16de', 'Seated Bent-Over Two-Arm Dumbbell Triceps Extension', '[''Sit down at the end of a flat bench with a dumbbell in both arms using a neutral grip (palms of the hand facing you).'', ''Bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Make sure that you keep the head up.'', ''The upper arms with the dumbbells should be close to the torso and aligned with it (lifted up until they are parallel to the floor while the forearms are pointing towards the floor as the hands hold the weights). Tip: There should be a 90-degree angle between the forearms and the upper arm. This is your starting position.'', ''Keeping the upper arms stationary, use the triceps to lift the weight as you exhale until the forearms are parallel to the floor and the whole arm is extended. Like many other arm exercises, only the forearm moves.'', ''After a second contraction at the top, slowly lower the dumbbells back to the starting position as you inhale.'', ''Repeat the movement for the prescribed amount of repetitions.'', ''This exercise can be executed also one arm at a time or alternating (like alternating dumbbell curls)'']', 1, 'Dip', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124355+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('2d31c192-f16e-44c8-919d-c399b405511c', 'Ez-Bar Curl', '[''Stand up straight while holding an EZ curl bar at the wide outer handle. The palms of your hands should be facing forward and slightly tilted inward due to the shape of the bar. Keep your elbows close to your torso. This will be your starting position.'', ''Now, while keeping your upper arms stationary, exhale and curl the weights forward while contracting the biceps. Focus on only moving your forearms.'', ''Continue to raise the weight until your biceps are fully contracted and the bar is at shoulder level. Hold the top contracted position for a moment and squeeze the biceps.'', ''Then inhale and slowly lower the bar back to the starting position.'', ''Repeat for the recommended amount of repetitions.'']', 2, 'Curl', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124356+00:00', 'GMT');",
