  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('dffdce3e-d6b9-4ddd-bf8b-4f9872929db4', 'Pronated Band Curl', NULL, NULL, 'Curl', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124367+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('ec4cce17-7b27-4a1b-838d-82a32d409476', 'Hammer Curls', '[''Stand up with your torso upright and a dumbbell on each hand being held at arms length. The elbows should be close to the torso.'', ''The palms of the hands should be facing your torso. This will be your starting position.'', ''Now, while holding your upper arm stationary, exhale and curl the weight forward while contracting the biceps. Continue to raise the weight until the biceps are fully contracted and the dumbbell is at shoulder level. Hold the contracted position for a brief moment as you squeeze the biceps. Tip: Focus on keeping the elbow stationary and only moving your forearm.'', ''After the brief pause, inhale and slowly begin the lower the dumbbells back down to the starting position.'', ''Repeat for the recommended amount of repetitions.'']', 2, 'Curl', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124369+00:00', 'GMT');",
