  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('b06640cf-54a2-475f-99e9-7f7cbe22a8d2', 'Tricep Band Pressdown', NULL, NULL, 'Pushdown', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124380+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('9737b95c-0a9f-46ab-8772-38a82765766f', 'One Arm Against Wall', '[''From a standing position, place a bent arm against a wall or doorway.'', ''Slowly lean toward your arm until you feel a stretch in your lats.'']', 2, 'Stretch', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124381+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('9ee50578-14e6-4b5e-92f1-b2e56ce8e064', 'Straight Bar Bench Mid Rows', '[''Place a loaded barbell on the end of a bench. Standing on the bench behind the bar, take a medium, pronated grip. Stand with your hips back and chest up, maintaining a neutral spine. This will be your starting position.'', ''Row the bar to your torso by retracting the shoulder blades and flexing the elbows. Use a controlled movement with no jerking.'', ''After a brief pause, slowly return the bar to the starting position, ensuring to go all the way down.'']', 1, 'Row', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124382+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('fb220d4e-014f-45c1-9257-b7f53895f531', 'Partner Supermans With Alternating High-Five', NULL, NULL, 'Superman', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124384+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('eaf43204-772e-46c1-b65d-4e40eb297ae0', 'Gironda Sternum Chins', '[''Grasp the pull-up bar with a shoulder width underhand grip.'', ''Now hang with your arms fully extended and stick your chest out and lean back. Tip: You will be leaning back throughout the entire movement. This will be your starting position.'', ''Start pulling yourself towards the bar with your spine arched throughout the movement and your head leaning back as far away from the bar as possible. Exhale as you perform this portion of the movement. Tip: At the upper end of the movement, your hips and legs will be at about a 45-degree angle to the floor.'', \"Keep pulling until your collarbone passes the bar and your lower chest or sternum area touches it. Hold that contraction for a second. Tip: By the time you''ve completed this portion of the movement; your head will be parallel to the floor.\", ''Slowly start going back to the starting position as you inhale.'', ''Repeat for the recommended amount of repetitions.'']', 1, 'Chin-up', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124385+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('3e55fa6a-b454-4c72-8b11-c4d19787f31e', 'Partner Facing Plank With Band Row', NULL, NULL, 'Row', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124386+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('f92675f9-fb20-445f-885a-19f28a9f8f02', 'Plate Row', '[''Stack the needed number of plates on top of a small plate on the ground, allowing you to easily grip the rims.'', ''Adopt a shoulder-width stance in front of the plates. Bend at the hip with your knees slightly bent, keeping your back flat. Grab the weights from the side and let them hang below your chest, arms extended. This will be your starting positioning.'', ''Maintaining a flat back, pull the weights to your chest by flexing the elbows. Do not jerk the weight.'', ''Return the weight to the starting position and repeat for the desired number of repetitions.'']', 1, 'Row', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124388+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('7f5109a7-b322-4ed2-a55e-634033f9eaac', 'Lower Back-Smr', NULL, NULL, 'Stretch', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124390+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('efc89901-b7e1-4416-89c5-ac9270c37419', 'Chin-Up', '[]', 2, 'Chin-up', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124391+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('bd75f376-42ae-4489-9a96-2fa062cc2fa3', 'Catch And Overhead Throw', '[''Begin standing while facing a wall or a partner.'', ''Using both hands, position the ball behind your head, stretching as much as possible, and forcefully throw the ball forward.'', ''Ensure that you follow your throw through, being prepared to receive your rebound from your throw. If you are throwing against the wall, make sure that you stand close enough to the wall to receive the rebound, and aim a little higher than you would with a partner.'']', 1, 'Pullover', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124392+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('92ff52b0-88c9-4f29-b55f-5f272ee14530', 'Rack Pull With Bands', '[''Set up in a power rack with the bar on the pins. The pins should be set to the desired point; just below the knees, just above, or in the mid thigh position. Attach bands to the base of the rack, or secure them with dumbbells. Attach the other end to the bar. You may need to choke the bands to provide tension.'', ''Position yourself against the bar in proper deadlifting position. Your feet should be under your hips, your grip shoulder width, back arched, and hips back to engage the hamstrings. Since the weight is typically heavy, you may use a mixed grip, a hook grip, or use straps to aid in holding the weight.'', ''With your head looking forward, extend through the hips and knees, pulling the weight up and back until lockout. Be sure to pull your shoulders back as you complete the movement. Return the weight to the pins and repeat.'']', 1, 'Rack pull', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124394+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('137158c7-e6b7-4119-97c9-73ca47a7a0c0', 'Man Maker', NULL, NULL, 'Row', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124395+00:00', 'GMT');",
