  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('43b04f13-97be-4658-ba50-4084467e4161', 'Flat Dumbbell Pull', NULL, NULL, 'Pullover', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124401+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('adeb5edd-8d8c-4fdd-8511-9e7b79a3bebf', 'Band Good Morning (Pull Through)', '[''Loop the band around a post. Standing a little ways away, loop the opposite end around the neck. Your hands can help hold the band in position.'', ''Begin by bending at the hips, getting your butt back as far as possible. Keep your back flat and bend forward to about 90 degrees. Your knees should be only slightly bent.'', ''Return to the starting position be driving through with the hips to come back to a standing position.'']', 1, 'Good morning', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124402+00:00', 'GMT');",
