  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('1cbba8ed-efb9-4551-8cde-6b77e3626d01', 'Farmer''S Walk', NULL, NULL, 'Grip walk', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124601+00:00', 'GMT');",
