  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('e2f980d8-66c7-498d-8eba-2db0cb41f01c', 'Dumbbell Wide-Stance Lunges', NULL, NULL, 'Lunge', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.124999+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('c754ed5e-8bd1-4122-9e3d-2b7baa03d075', '90/90 Hamstring', '[''Lie on your back, with one leg extended straight out.'', ''With the other leg, bend the hip and knee to 90 degrees. You may brace your leg with your hands if necessary. This will be your starting position.'', ''Extend your leg straight into the air, pausing briefly at the top. Return the leg to the starting position.'', ''Repeat for 10-20 repetitions, and then switch to the other leg.'']', 1, 'Stretch', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125001+00:00', 'GMT');",
