  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('c7c4936e-1bfd-4a4f-ada1-a4392a47d076', 'Lying Leg Curls-High Rep', NULL, NULL, 'Curl', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125169+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('67eee7a3-5757-410c-91a1-7a987b745a73', 'Split Squat Hold', NULL, NULL, 'Squat (Split)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125170+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('568e297c-bb33-4af0-be16-b3cbe75dbcd2', 'Stairs Calf Raises', NULL, NULL, 'Calf raise', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125172+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('ef92eb32-4c51-4d87-8eae-78fd952130c1', 'One-Leg Glute Bridge', NULL, NULL, 'Bridge', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125173+00:00', 'GMT');",
