  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('ba7b4606-d309-4aeb-a8e4-cba35ad42007', 'Vertical Jump', '[]', 2, 'Jump', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125175+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('2a056a74-d72d-406d-88ca-0fdc1a17108c', 'Groiners ', NULL, NULL, 'Stretch', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125176+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('b98ec7c8-fee1-4d6c-8dd9-038a39539877', 'Slideboard Hamstring Curl (5 Seconds Neg)', NULL, NULL, 'Curl', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125178+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('46cd6541-9476-4d2b-bec0-4b9c139a857e', 'Seated Leg Curls Hi Rep', NULL, NULL, 'Curl', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125179+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('3fcbcae3-365c-4b50-9d8f-b9cf48556735', 'Dumbbell Reverse Lunge', '[''Stand with your torso upright holding two dumbbells in your hands by your sides. This will be your starting position.'', ''Step backward with your right leg around two feet or so from the left foot and lower your upper body down, while keeping the torso upright and maintaining balance. Inhale as you go down. Tip: As in the other exercises, do not allow your knee to go forward beyond your toes as you come down, as this will put undue stress on the knee joint. Make sure that you keep your front shin perpendicular to the ground. Keep the torso upright during the lunge; flexible hip flexors are important. A long lunge emphasizes the Gluteus Maximus; a short lunge emphasizes Quadriceps.'', ''Push up and go back to the starting position as you exhale. Tip: Use the ball of your feet to push in order to accentuate the quadriceps. To focus on the glutes, press with your heels.'', ''Now repeat with the opposite leg.'']', 2, 'Lunge', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125180+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('73a92c2a-4e8e-48e1-ac0b-4533fd195881', 'One-Leg Flute Bridge', NULL, NULL, 'Bridge', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125182+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('43f9309f-eb9b-4e1a-b665-bcf6f1cdefe5', 'One-Arm Stability Ball Wall Hold', NULL, NULL, 'Balance', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125183+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('69abe8a5-0652-419c-a9db-70e1e055c9d0', 'One-Arm Stability Ball Wall Hold With Mini Circles', NULL, NULL, 'Balance', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125185+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('edb6944d-9c48-4184-b84e-f60d3701a00e', 'Butt Lift (Bridge)', NULL, NULL, 'Bridge', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125186+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('93b51dc8-0500-4668-bc8f-533485206613', 'Wide Stance Barbell Squat', NULL, NULL, 'Squat (Sumo)', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125187+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('17c453bd-10a0-46e5-a93e-b49d46c243d7', 'Lying Side Extensions', NULL, NULL, 'Hip extension', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125188+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('1928296c-2868-49dc-96bb-941d6c04acde', 'Running, Treadmill', NULL, NULL, 'Cardio', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125189+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('c7462622-97fc-4dc3-a1c3-7c7cf4c75b6a', 'Trail Running/Walking', '[''Running or hiking on trails will get the blood pumping and heart beating almost immediately. Make sure you have good shoes. While you use the muscles in your calves and buttocks to pull yourself up a hill, the knees, joints and ankles absorb the bulk of the pounding coming back down. Take smaller steps as you walk downhill, keep your knees bent to reduce the impact and slow down to avoid falling.'', ''A 150 lb person can burn over 200 calories for 30 minutes walking uphill, compared to 175 on a flat surface. If running the trail, a 150 lb person can burn well over 500 calories in 30 minutes.'']', 2, 'Cardio', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125190+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('a8c462d3-b214-4cd8-b198-2d2d68d1c3a1', 'Lateral Miniband Walk (Knees)', NULL, NULL, 'Hip extension', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125192+00:00', 'GMT');",
