  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('984e62be-e97a-4776-a105-f7440f5a5b94', 'Hip Abductor Machine Circuit', NULL, NULL, 'Abduction', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125197+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('851c831b-1efa-4f1b-9939-119eafac0073', 'Smith Machine Hip Thrust', NULL, NULL, 'Thrust', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125198+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('75b4d461-22f4-4290-a6b7-4536938fc83a', 'Dumbbell Reverse Lunge', '[''Stand with your torso upright holding two dumbbells in your hands by your sides. This will be your starting position.'', ''Step backward with your right leg around two feet or so from the left foot and lower your upper body down, while keeping the torso upright and maintaining balance. Inhale as you go down. Tip: As in the other exercises, do not allow your knee to go forward beyond your toes as you come down, as this will put undue stress on the knee joint. Make sure that you keep your front shin perpendicular to the ground. Keep the torso upright during the lunge; flexible hip flexors are important. A long lunge emphasizes the Gluteus Maximus; a short lunge emphasizes Quadriceps.'', ''Push up and go back to the starting position as you exhale. Tip: Use the ball of your feet to push in order to accentuate the quadriceps. To focus on the glutes, press with your heels.'', ''Now repeat with the opposite leg.'']', 2, 'Lunge', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125200+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('fc76ecfa-a76f-4e07-b5c0-c8154c22aac8', 'Broad Jump', '[''This drill is best done in sand or other soft landing surface. Ensure that you are able to measure distance. Stand in a partial squat stance with feet shoulder width apart.'', ''Utilizing a big arm swing and a countermovement of the legs, jump forward as far as you can.'', ''Attempt to land with your feet out in front you, reaching as far as possible with your legs.'', ''Measure the distance from your landing point to the starting point and track results.'']', 2, 'Jump', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125201+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('a94ff976-a83d-4516-8e82-c440a7272923', 'Front Squat (Bodybuilder)', '[''Set the bar in a rack slightly below shoulder level so that when under it, your knees are slightly bent. Rest the bar on top of the deltoids, pushing into the clavicles, and lightly touching the throat.'', ''Once the correct height is chosen and the bar is loaded, bring your arms up under the bar while keeping the elbows high and the upper arm parallel to the floor. Rest the bar on top of the deltoids and cross your arms while grasping the bar for total control.'', ''Push upward into the bar and push your hips forward to unrack. Step away from the rack and position your legs using a shoulder-width medium stance with the toes slightly pointed out. Keep your head and elbows up at all times. Keep a neutral neck and flat back. This will be your starting position.'', ''Descend into a squat by pushing your hips and butt backwards. Continue down until the upper legs are at or just below parallel to the floor. Inhale as you perform this portion of the movement.'', ''Drive up through your heels, pushing your feet and knees out. Continue upward, maintaining tightness head to toe, until you have returned to the starting position. Repeat for the recommended amount of repetitions.'']', 2, 'Squat (Front)', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125202+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('24c131b0-93a7-4bd4-a62b-14e912f4da0b', '50-Yard Shuttle Run', NULL, NULL, 'Cardio', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125203+00:00', 'GMT');",
