  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('ca9bc5a2-28be-449f-b8a1-bfbd5c5681c2', '75 Yard Run @ 80%', NULL, NULL, 'Cardio', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125208+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('87ac3c07-b3dd-4535-9100-8a8f28265312', '75-Yard Temp Run @ 80%', NULL, NULL, 'Cardio', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125209+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('d3dc0859-060c-4f02-9ffd-605ddb5fb37c', 'Front Squat (Clean Grip)', '[''Set the bar in a rack slightly below shoulder level so that when under it, your knees are slightly bent. Rest the bar on top of the deltoids, pushing into the clavicles, and lightly touching the throat. Your hands should be in a clean grip, touching the bar only with your fingers to help keep it in position.'', ''Push upward into the bar and push your hips forward to unrack. Step away from the rack and position your legs using a shoulder-width medium stance with the toes slightly pointed out. Keep your head and elbows up at all times. Your triceps should remain parallel with the ground. Keep a neutral neck and flat back. This will be your starting position.'', ''Descend into a squat by pushing your hips and butt backwards. Continue down until the upper legs are at or just below parallel to the floor. Inhale as you perform this portion of the movement.'', ''Drive up through your heels, pushing your feet and knees out. Continue upward, maintaining tightness head to toe, until you have returned to the starting position. Repeat for the recommended amount of repetitions.'']', 1, 'Squat (Front)', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125210+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('f5647bfe-ad9b-4f69-8c1f-b86890fd6a78', 'Slideboard Hamstring Curl With One-Leg Negative', NULL, NULL, 'Curl', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125211+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('a4b8eba2-87e8-4865-b1c2-38784efc75d0', 'Front Dumbbell Raise Using Towel', NULL, NULL, 'Raise (Front)', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125213+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('f2ee8584-d7a8-47bb-9ba9-2bf7be436dcb', 'Kettlebell Arnold Press', '[''Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you raise the kettlebell towards your shoulder. The palm should be facing inward.'', ''Looking straight ahead, press the kettlebell out and overhead, rotating your wrist so that your palm faces forward at the top of the motion.'', ''Return the kettlebell to the starting position, with the palm facing in.'']', 1, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125214+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('5f9adb5e-5e9b-4dd3-b504-44624f6430d7', 'Dumbbell Clean And Jerk', '[''Hold a dumbbell down by your side with a neutral grip. Clean the dumbbell to your shoulder by extending through the legs and hips as you pull the dumbbell towards your shoulder. Make sure to keep you hand in the neutral position and your elbow pointed forward.'', ''Dip your body by bending the knees, keeping your torso upright.'', \"Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the dumbbell overhead to lockout by extending the arms, using your body''s momentum to move the weight.\", ''Lower the dumbbell slowly to the starting position, allowing your knees to bend slightly to lessen the blow. Repeat for recommended number of repetitions.'']', 1, 'Clean and Jerk', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125215+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('caa86cb8-d29f-46e9-83e4-efc9077b4d60', 'Axle Clean And Press', '[''Assume a shoulder-width stance, with knees inside the arms.'', ''While keeping the back flat, bend at the knees and hips so that you can grab the bar with the arms fully extended and a mixed grip that is slightly wider than shoulder width. The bar should be close to the shins with the shoulders over or slightly ahead of the bar. This will be your starting position.'', ''Extend the knees to raise the weight, keeping the angle of the back constant. Continue to lift the bar straight up, while keeping it close to your body.'', ''As the bar passes the knee, extend at the ankles, knees, and hips forcefully similar to a jumping motion. As you do so, continue to guide to bar with your hands, shrugging your shoulders and using the momentum from your movement to pull the bar as high as possible. The bar should travel close to your body, and you should keep your elbows out.'', ''At maximum elevation lean back and rest the bar on your torso. Switch your grip to a double overhand, and hitch the weight onto the front of the shoulders. Without moving your feet, press the bar overhead by extending the elbows.'', ''Return the bar to the floor under control.'']', 1, 'Clean', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125216+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('09f90b47-fce9-4a8d-9771-1187a0e7dfd9', 'Shoulder Raise', '[''Relax your arms to your sides and raise your shoulders up toward your ears, then back down.'']', 2, 'Raise (Front)', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125217+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('3c6d1c8c-8acb-4dde-802e-c537412a521f', 'Circus Bell', '[''The circus bell is an oversized dumbbell with a thick handle. Begin with the dumbbell between your feet, and grip the handle with both hands.'', ''Clean the dumbbell by extending through your hips and knees to deliver the implement to the desired shoulder, letting go with the extra hand.'', ''Ensure that you get one of the dumbbell heads behind the shoulder to keep from being thrown off balance. To raise it overhead, dip by flexing the knees, and the drive upwards as you extend the dumbbell overhead, leaning slightly away from it as you do so.'', ''Carefully guide the bell back to the floor, keeping it under control as much as possible. It is best to perform this event on a thick rubber mat to prevent damage to the floor.'']', 1, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125220+00:00', 'GMT');",
