  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('c50f1ef5-8fda-4b34-bdd8-4d6b34d9886c', 'Barbell Hang Cleans', NULL, NULL, 'Clean', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125230+00:00', 'GMT');",
