  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('9104b0c3-58f2-4ba3-ac12-cb651ba58a99', 'Standing Palm-In One-Arm Dumbbell Press', NULL, NULL, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125388+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('bdd6bb35-1edb-4091-b558-91fb4c7c5047', 'Leverage Shoulder Press', NULL, NULL, 'Press (Horizontal)', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125390+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('0c2f4918-3106-4239-bbc0-40a4e5aa7f46', 'Seated Dumbbell Press', '[''Grab a couple of dumbbells and sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs.'', ''Clean the dumbbells up one at a time by using your thighs to bring the dumbbells up to shoulder height at each side.'', ''Rotate the wrists so that the palms of your hands are facing forward. This is your starting position.'', ''As you exhale, push the dumbbells up until they touch at the top.'', ''After a second pause, slowly come down back to the starting position as you inhale.'', ''Repeat for the recommended amount of repetitions.'', ''You can perform the exercise standing or sitting on a regular flat bench. For people with lower back problems, the version described is the recommended one.'', ''You can also perform the exercise as Arnold Schwarzenegger used to do it, which is to start holding the dumbbells with a supinated grip (palms facing you) in front of your shoulders and then, as you start pushing up, you align the dumbbells in the starting position described on step 3 by rotating your wrists and touch the dumbbells at the top. As you come down, then you would go back to the starting position by rotating the wrist throughout the lowering portion until the palms of your hands are facing you. This variation is called the Arnold Press. However, it is not recommended if you have rotator cuff problems.'']', 2, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125391+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('777ad11e-c451-43c9-9cb3-01749b9cb286', 'Reverse Pec-Deck Flye', NULL, NULL, 'Fly (Reverse)', 'Unilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125393+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('eb171594-deda-4b85-a89a-f83f23b408dc', 'Barbell Front Raises', NULL, NULL, 'Raise (Front)', 'Bilateral', 'Accessory', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125394+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('0ad1d5ed-6ed1-49af-b248-829506df5d7a', 'Clean And Press', '[''Assume a shoulder-width stance, with knees inside the arms. Now while keeping the back flat, bend at the knees and hips so that you can grab the bar with the arms fully extended and a pronated grip that is slightly wider than shoulder width. Point the elbows out to sides. The bar should be close to the shins. Position the shoulders over or slightly ahead of the bar. Establish a flat back posture. This will be your starting position.'', ''Begin to pull the bar by extending the knees. Move your hips forward and raise the shoulders at the same rate while keeping the angle of the back constant; continue to lift the bar straight up while keeping it close to your body.'', ''As the bar passes the knee, extend at the ankles, knees, and hips forcefully, similar to a jumping motion. As you do so, continue to guide the bar with your hands, shrugging your shoulders and using the momentum from your movement to pull the bar as high as possible. The bar should travel close to your body, and you should keep your elbows out.'', ''At maximum elevation, your feet should clear the floor and you should start to pull yourself under the bar. The mechanics of this could change slightly, depending on the weight used. You should descend into a squatting position as you pull yourself under the bar.'', ''As the bar hits terminal height, rotate your elbows around and under the bar. Rack the bar across the front of the shoulders while keeping the torso erect and flexing the hips and knees to absorb the weight of the bar.'', ''Stand to full height, holding the bar in the clean position.'', ''Without moving your feet, press the bar overhead as you exhale. Lower the bar under control .'']', 2, 'Clean', 'Bilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125395+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('f8270c43-01e7-4fc0-ad58-9547e7f39999', 'Half-Kneeling One-Arm Dumbbell Overhead Press', NULL, NULL, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125396+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('b68c107c-9b93-4f59-b509-748ddb5a7ac9', 'Standing Dumbbell Press ', NULL, NULL, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125397+00:00', 'GMT');",
  "INSERT INTO exercise (exercise_id, name, instructions, difficulty_level, category, laterality, exercise_type, verified, created_by, created_at, timezone) VALUES ('9c433de2-f171-493a-9abe-1261ba43ba67', 'Machine Shoulder (Military) Press', '[''Sit down on the Shoulder Press Machine and select the weight.'', ''Grab the handles to your sides as you keep the elbows bent and in line with your torso. This will be your starting position.'', ''Now lift the handles as you exhale and you extend the arms fully. At the top of the position make sure that you hold the contraction for a second.'', ''Lower the handles slowly back to the starting position as you inhale.'', ''Repeat for the recommended amount of repetitions.'']', 2, 'Press (Horizontal)', 'Unilateral', 'Compound', true, 'c87ec315-2a56-40dd-9b96-22840ab11088', '2024-03-23 16:00:30.125399+00:00', 'GMT');",
